sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        var subFlowInputs = {};
        subFlowInputs['department'] = inputs.department;
        subFlowInputs['location'] = inputs.location;
        subFlowInputs['job_profile'] = inputs.job_profile;
        subFlowInputs['worker_profile'] = inputs.worker_profile;
        subFlowInputs['effective_worker_profile'] = inputs.effective_worker_profile;
        subFlowInputs['future_worker_profile'] = inputs.future_worker_profile;
        subFlowInputs['retrieve_all_data'] = inputs.retrieve_all_data;
        subFlowInputs['pull_to_dos'] = inputs.pull_to_dos;
        var contextId = sn_fd.FlowAPI.startSubflow('sn_hr_workday.run_workday_service', subFlowInputs);
        outputs.status = 'Success';
    } catch (ex) {
        outputs.status = 'Error';
        outputs.error_message = 'Encountered an error. Check log for more details';
        var message = ex.getMessage();
    }
})(inputs, outputs);

